import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css'],
})
export class HeaderComponent {
  @Input() quote!: string;
}
<div class="w-full flex justify-center">
  <div class="header flex flex-col items-center w-max">
    <h1 class="text-5xl font-semibold uppercase text-gray-500">
      Welcome to
      <span class="ml-4 text-gray-700 font-bold">Putrid Grove</span>
    </h1>
    <div class="w-7/12 text-lg text-gray-700 text-center mt-24">testing</div>
  </div>
</div>
